import { StyleSheet, View } from 'react-native';
import { auth } from "../firebase";
import EditScreenInfo from '../components/EditScreenInfo';
import { Button, ButtonGroup, withTheme, Text, Input } from 'react-native-elements';
import { SettingStackParamList, RootTabParamList, SettingStackProps } from '../types';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import SettingScreen from '../screens/SettingScreen';
import CreatePostScreen from '../screens/CreatePostScreen';
const Stack = createNativeStackNavigator<SettingStackParamList>();

export default function SettingsScreen({ navigation }: SettingStackProps<'SettingHome'>) {
  return (
    <Stack.Navigator>
      <Stack.Screen options={{ headerShown: false }} name="Setting" component={SettingScreen}
      ></Stack.Screen>
      <Stack.Screen options={{ headerShown: false }} name="CreatePost" component={CreatePostScreen}></Stack.Screen>
    </Stack.Navigator>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  title: {
    fontSize: 20,
    fontWeight: 'bold',
  },
  separator: {
    marginVertical: 30,
    height: 1,
    width: '80%',
  },
});
